import React,{useState} from "react";
import {Route, Routes, BrowserRouter} from 'react-router-dom'
import Records from "./pages/records";




function App() {
  
  return (
    <BrowserRouter>
      
    <Routes>
        <Route path="/" element={<Records/>}/>
    </Routes>
 </BrowserRouter>
    
  );
}

export default App;
